import React, { Fragment } from "react";
import { TextInput } from "react-materialize";

export default ({
  nome,
  desc,
  opcoes,
  respostaTexto,
  handleChangeText,
  dadoAdicionalId
}) => (
  <Fragment>
    <h5>
      <i className="material-icons left">question_answer</i>
      {nome}
    </h5>
    <p className="basicInfo grey-text text-darken-2">{desc}</p>
    <TextInput
      s={12}
      value={
        respostaTexto.filter(txt => txt.dadoAdicionalId === dadoAdicionalId)[0]
          .texto
      }
      onChange={handleChangeText}
    />
    {/* {opcoes.map(opcao => (
      <TextInput
        key={opcao.id}
        s={12}
        label={nome}
        value={
          respostaTexto.filter(
            txt => txt.dadoAdicionalId === dadoAdicionalId
          )[0].texto
        }
        onChange={handleChangeText(opcao.id)}
      />
    ))} */}
    <br />
  </Fragment>
);
